const vidplayaStyle ={
    vidCard: {
        height: '140vh',
        width: '70vw'
    },
    player1: {
        position: 'absolute',
        marginLeft: '5vw',
        boxShadow: '5px 5px 7px 7px #888888'
    },
    player2: {
        position: 'absolute',
        marginLeft: '40vw',
        marginTop: '70vh',
        boxShadow: '5px 5px 7px 7px #888888'
    },
    title: {
        fontFamily: "army",
        fontSize: "6vw",
        fontWeight: "600",
        display: "inline-block",
        position: "absolute",
        marginLeft: "60vw",
        marginTop: "20vh"
    },
};

export default vidplayaStyle;
